import React from "react";
import { Layout, Avatar, Menu, Button, Row, Col } from "antd";
import { DownloadOutlined } from "@ant-design/icons";
const { Header, Footer, Slider, Content } = Layout;
import Title from "antd/lib/typography/Title";
// import utilCss from "../styles/app.module.css";
//import Style from "../styles/home.css";

export default function home() {
  return (
    <>
      <Layout className="layout">
        <Header>
          <div className="logo">
            <img style={{ borderRadius: "4px" }} src="./images/logo.png" />
          </div>
          <Menu
            style={{
              float: "right",
              backgroundColor: "transparent !important",
              color: "#d8d8d8",
            }}
            mode="horizontal"
            defaultSelectedKeys={["1"]}
          >
            <Menu.Item key="1" className="customclass">
              Home
            </Menu.Item>
            <Menu.Item key="2" className="customclass">
             Our Food
            </Menu.Item>
            <Menu.Item key="3" className="customclass">
              nav 3
            </Menu.Item>
            <Menu.Item>
              <Button
                style={{
                  borderRadius: "12px",
                  backgroundColor: "#74cf4e",
                  color: "white",
                }}
                // type="sucess"
                // icon={<DownloadOutlined />}
              >
                Signup / login
              </Button>
            </Menu.Item>
          </Menu>
        </Header>
        <Row className="headerBg" gutter={[16, 24]}>
          <Col className="gutter-row" span={13} style={{ marginTop: "91px" }}>
            Lorem Ipsum is simply dummy text of the printing and typesetting
            industry. Lorem Ipsum has been the industry's standard dummy text
            ever since the 1500s, when an unknown printer took a galley of type
            and scrambled it to make a type specimen book. It has survived not
            only five centuries, but also the leap into electronic typesetting,
            remaining essentially unchanged. It was popularised in the 1960s
            with the release of Letraset sheets containing Lorem Ipsum passages,
            and more recently with desktop publishing software like Aldus
            PageMaker including versions of Lorem Ipsum
          </Col>
          <Col className="gutter-row" span={11}>
            {" "}
            <img
              style={{ filter: "brightness(74%)" }}
              src="./images/headerBg.png"
            />
          </Col>
        </Row>
      </Layout>
    </>
  );
}
